import React from 'react'
var tf = require('@tensorflow/tfjs')

let model = null
// let uri = window.location.href + 'src/components/modelJS/model.json'
console.log(window.location.href)
model = tf.loadLayersModel('https://drive.google.com/open?id=19Ekdcwl9UObw16jLJUu6FWcZutFONNrN')

const Main = () => {

	if (model == null)
		console.log('model loaded')
	return null
}

export default Main;
